webpackJsonp([0x7d4077331c4d],{331:function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Assertion</h3>\n<p>My primary focus on this project was to lead and implement the user interface development which functions to administer data sources (PLCs) and provide a view of realtime graph data.</p>\n<p>Because I have fairly extensive professional experience, and am currently employed full time as a Software Engineer I was tasked with leading the frontend team. I was also able to offer advice and assistance to team members in the other teams based on my prior experience working with similar architectures and technologies.</p>\n<p>Since the project did not have any existing UI I was able to decide on the technology stack to be used, and how the project would be structured.</p>\n<p>I have very particular preferences when it comes to certain aspects of software development, and I put these into place on this project as well. These include the folder structure for source code, code style standards, and git commit message format, as well as my preference for lightweight issue/task management.</p>\n<p>In the previous unit, the team had used Trello for issue management, but I recommended a switch to using the issue management feature provided with GitLab. This reduces context switching and enables other features like closing issues via git commit or merge, which is a productivity enhancement.</p>\n<p>We used GitLab issues for task management:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-f76d8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; padding:8px;box-shadow: 0px 2px 8px 0px rgba(0, 0, 0, 0.3);; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 80.658159838818%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image of GitLab Issues List"\n        title=""\n        src="/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-32f52.png"\n        srcset="/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-e1c02.png 148w,\n/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-ba2da.png 295w,\n/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-32f52.png 590w,\n/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-39f16.png 885w,\n/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-1fb1a.png 1180w,\n/deakin-portfolio/static/akd-gitlab-issues-bdd5d487df3468a8763cb816f3ff8f1f-f76d8.png 1489w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>GitLab provides a Kanban style issue board:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-d4506.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; padding:8px;box-shadow: 0px 2px 8px 0px rgba(0, 0, 0, 0.3);; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.56404230317274%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image of GitLab Issues Board"\n        title=""\n        src="/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-32f52.png"\n        srcset="/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-e1c02.png 148w,\n/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-ba2da.png 295w,\n/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-32f52.png 590w,\n/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-39f16.png 885w,\n/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-1fb1a.png 1180w,\n/deakin-portfolio/static/akd-gitlab-issue-board-ef9bff0b3c3119347b20604ca211cfdb-d4506.png 1702w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>My first task was to setup the project for a containerized environment, which would allow the team to focus on forward development, and not having to spend inordinate amounts of time on environment setup. It\'s also how we had planned to deliver the end product as well, and I firmly believe in tackling this aspect up front on any project. Unfortunately due to lack of experience with docker and containerization concepts in the group, there was still more time lost than expected on setup, but myself and Daniel were able to help out to bring everyone up to speed.</p>\n<p>Once deployment and runtime environment concerns had been addressed, I moved onto UI development.</p>\n<p>I already had a good idea of how to get a boilerplate in place quickly, that would allow me to focus on the core feature development. I chose to use React since that is the JavaScript view framwork I work in every day. This would enable me to move quickly, and again, focus on the business logic rather than the intricacies of implementation.</p>\n<p>The end result can be seen both on the <a href="/deakin-portfolio/project">project page →</a> and the source code is public on <a href="https://gitlab.com/SIT302-Data-Logger/PLC-DataLogger">GitLab →</a>. In the end, I solely implemented nearly all of the UI:</p>\n<ul>\n<li>Layout and initial styling</li>\n<li>Source and tag configuration</li>\n<li>API data fetching and parsing</li>\n<li>Realtime data connection to mqtt</li>\n<li>Realtime data graph</li>\n</ul>\n<p>My contribution graph from the GitLab source code repository:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-94342.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; padding:8px;box-shadow: 0px 2px 8px 0px rgba(0, 0, 0, 0.3);; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.39494470774092%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Image of contribution graph from GitLab"\n        title=""\n        src="/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-32f52.png"\n        srcset="/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-e1c02.png 148w,\n/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-ba2da.png 295w,\n/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-32f52.png 590w,\n/deakin-portfolio/static/akd-gitlab-contrib-graph-3c52eeb9561b2eb050259b366ce9d559-94342.png 633w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \nSource: <a href="https://gitlab.com/SIT302-Data-Logger/PLC-DataLogger/graphs/master">GitLab Repository →</a></p>',frontmatter:{date:"May 31, 2018",path:"/post",title:"Projects - AKD Softwoods"}}},pathContext:{}}}});
